settings.customCss:
.tc-right-sidebar {
    display: none;
}

@media screen and (min-width: 767px) {
    .tc-right-sidebar+#list-area {
        width: -webkit-fill-available;
    }
}
span.user-title.user-title
 {
    -webkit-text-fill-color: var(--primary-med-or-secondary-med);
    background: transparent;
    will-change: unset;
    animation: none;
}
